import React, {Component} from 'react';

class Content extends Component {

    render() {
        return(

            <div style={{color:this.props.color}}>

                <h1>Hello another {this.props.name}</h1>
                <br />
                <i>
                    {this.props.children}
                </i>

            </div>


        )
    }


}

export default Content
